import axios from 'axios';
import React, { useState } from 'react';

const FetchPolicyNames = () => {
  const [email, setEmail] = useState('');
  const [policies, setPolicies] = useState([]);

  const fetchPolicies = async (userEmail) => {
    try {
      const response = await axios.get(`http://localhost:8080/admin/check/${userEmail}`, {
        headers: {
          'Content-Type': 'application/json',
          'Authorization': 'Basic YWRtaW4xMjM6Y21z',
        },
        withCredentials: true,
      });
      console.log(response.data);
      setPolicies(response.data.map(policy => policy.policyName));
    } catch (error) {
      if (error.response) {
        // The request was made and the server responded with a status code outside of the 2xx range
        console.error('Server responded with status:', error.response.status);
        console.error('Response data:', error.response.data);
      } else if (error.request) {
        // The request was made but no response was received
        console.error('No response received:', error.request);
      } else {
        // Something happened in setting up the request that triggered an error
        console.error('Error setting up the request:', error.message);
      }
      console.error('Error details:', error.config);
    }
  };

  const handleFetchPolicies = () => {
    if (email) {
      fetchPolicies(email);
    } else {
      alert('Please enter an email address.');
    }
  };

  return (
    <div>
      <input
        type="email"
        placeholder="Enter your email"
        value={email}
        onChange={(e) => setEmail(e.target.value)}
        required
      />
      <button onClick={handleFetchPolicies}>Fetch Policies</button>
      <div>
        <h3>Available Policies:</h3>
        <ul>
          {policies.map((policy, index) => (
            <li key={index}>{policy}</li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default FetchPolicyNames;
